Onboarding.BeginFlow = function ( f7_arg0, f7_arg1, f7_arg2 )
	if f7_arg0._activeFlow then
		return false
	else
		assert( f7_arg2 )
		if f7_arg1:WasCompleted( f7_arg2 ) then
			return false
		else
			assert( 0 < #f7_arg1.stages )
			f7_arg0._activeFlow = f7_arg1
			f7_arg0._currentStage = 1
			f7_arg0._controllerIndex = f7_arg2
			return true
		end
	end
end

Onboarding.IsFlowInProgress = function ( f6_arg0, f6_arg1 )
	return f6_arg1 == f6_arg0._activeFlow
end

Onboarding.AdvanceFlow = function ( f5_arg0, f5_arg1, f5_arg2 )
	if f5_arg0._activeFlow ~= f5_arg1 then
		return false
	end
	local f5_local0 = false
	for f5_local4, f5_local5 in ipairs( f5_arg0._activeFlow.stages ) do
		if f5_local5.name == f5_arg2 and f5_local4 == f5_arg0._currentStage then
			f5_arg0._currentStage = f5_arg0._currentStage + 1
			DebugPrint( "Onboarding completed stage: " .. f5_arg2 )
			f5_local0 = true
			break
		end
	end
	if #f5_arg0._activeFlow.stages < f5_arg0._currentStage then
		f5_arg0:CompleteFlow()
	end
	return f5_local0
end

Onboarding.ResetFlow = function ( f4_arg0, f4_arg1 )
	if f4_arg0._activeFlow and f4_arg0._activeFlow == f4_arg1 then
		f4_arg0._activeFlow = nil
		f4_arg0._currentStage = nil
		f4_arg0._controllerIndex = nil
	end
end

Onboarding.CompleteFlow = function ( f3_arg0 )
	if f3_arg0._activeFlow then
		f3_arg0._activeFlow:MarkCompleted( f3_arg0._controllerIndex )
		f3_arg0._activeFlow = nil
		f3_arg0._currentStage = nil
		f3_arg0._controllerIndex = nil
	end
end

